import * as userOperations from './actions'

import { combineReducers } from 'redux'
import {
  loginReducer,
  signUpReducer,
  userLogoutReducer,
  userPersonalInfoReducer,
} from './reducers'

export const rootReducer = combineReducers({
  userLogin: loginReducer,
  userCreate: signUpReducer,
  userLogout: userLogoutReducer,
  userPersonalInfo: userPersonalInfoReducer,
})

export { userOperations }

export default rootReducer
